import React from 'react';
import ReactDOM from 'react-dom';

const AppHeader = () => <h1>Todo List</h1>;

const SearchPanel = () => <input placeholder='search' />;

const TodoList = () => {
  const items = ['Learn React', 'Build awesome App']
  return (<ul>
    <li>{items[0]}</li>
    <li>{items[1]}</li>
  </ul>);
}

const App = () => {
  return (
    <div>
      <span>{new Date()}</span>
      <AppHeader />
      <SearchPanel />
      <TodoList />
    </div>
  );
};

ReactDOM.render(<App />,
  document.getElementById('root'));
